import React from "react";
import { ReactComponent as Logo } from "./sun.svg";
import "./css/header.css";
function Header() {
  return (
    <nav className="navbar">
      <Logo className="sun" />
      <h2 className="navbar__heading">Myweather</h2>
    </nav>
  );
}

export default Header;
